#获取测试图片的列表
def get_png_list(test_png_folder_path:str):
    png_list = os.listdir(test_png_folder_path)
    filter_list = filter(lambda png:os.path.splitext(png)[-1] == ".png", png_list)

    return list(filter_list)

#将png图片转换为base64字符串
def gen_base64_img_snippet(image_path:str):
    with open(image_path,'rb') as img_f:
        img_data = img_f.read()
        base64_data = base64.b64encode(img_data)
        base64_str = str(base64_data,'utf-8')
        # print(base64_str)
        img_f.close()
        return base64_str

#将字符串转为jpg图片
def str_to_base64(sstr, name):
    image_data = base64.b64decode(sstr)
    jpg_file = open(f'/Users/xiaoyong/Documents/性能数据/ly/{name}.jpg', 'wb')
    jpg_file.write(image_data)
    jpg_file.close()

